Insert into CONNECTJOB.COMPANY_REVIEW (REVIEW_NO,REVIEW_MEMBER,REVIEW_COMPANY,REVIEW_ISCURRENT,REVIEW_JOB,REVIEW_EMPLOY_CATE,REVIEW_CAREER,REVIEW_LOCATION,REVIEW_TOTAL_SCORE,REVIEW_SHORT,REVIEW_MERIT,REVIEW_DISMERIT,REVIEW_REQUEST,REVIEW_GRADE_01,REVIEW_GRADE_02,REVIEW_GRADE_03,REVIEW_GRADE_04,REVIEW_GRADE_05,REVIEW_LIKE,REVIEW_DATE,REVIEW_STATUS) values (29,'admin2@admin.com',521,'전 직장 - 2016년 퇴사','하드웨어 엔지니어','아르바이트','10년차','세종',1,'비추비추... ㅠㅠ','예) 연차를 윗사람 눈치 안 보고 쓸 수 있음, 도서구입비, 학원 수강료 등 자기 계발 비용 지원, 야근 식대 1만원까지 제공, 수평적인 사무실 분위기. 업무 분담 체계가 확실해 자기 분야 전문성을 기를 수 있음. 사업기반이 안정적이고 체계적인 교육시스템이 갖춰져 신입에게 추천','예) 단순 보고를 위한 문서 작업이 많아 비효율적. 복지 제도가 다양하지만 실제로 쓸 수 없음. 출근 시간은 8시인데 퇴근 시간은 ???. 연봉이 많다지만 시간급은 형편없음. 과장 차장이 많아 승진이 힘들다." ','예) 신규 사업 추진에 적극적인 투자 의지를 보여줬으면. 직원들의 불만을 듣지만 말고 해결책을 마련해줬으면. 합리적인 복지 및 보상 체계를 마련해줬으면 좋겠다. 군대 문화를 줄여줬으면 좋겠다.',3,1,1,2,2,0,to_date('19/04/04','RR/MM/DD'),'Y');
