Insert into CONNECTJOB.S_TALK (S_NO,S_JOB,Q_TYPE,S_TITLE,S_CONTENT,S_HITS,S_DATE,P_ID,STATUS,S_CATE) values (1,null,'회사고민','일본회사에 대한 고민입니다','<p>안녕하세요</p><p>저번 주중에도 글을 한 번 썼는데 생각할 옵션이 늘어나서 고민이 된 나머지 한 번 더 쓰게 되었습니다</p><p>너무 자주 비슷한 글 올리지 않도록 하겠습니다 ㅠㅠ 혹시 문제가 된다면 알려주세요</p><p>혹시 신입 개발자의 입장이라면 어느 회사로 갈지.. 부탁드립니다.</p><p><br>&nbsp;</p><p>현재상황: 업무 변경해서 신입으로 가는 상황 / 목적은 미래를 생각해서 많이 배우기 / 회사 위치 일본 / 나이 20대 후반 / 현재 연봉 4천 후반</p>',0,to_date('19/04/14','RR/MM/DD'),'sihus2@naver.com','FALSE','웹 개발자');
Insert into CONNECTJOB.S_TALK (S_NO,S_JOB,Q_TYPE,S_TITLE,S_CONTENT,S_HITS,S_DATE,P_ID,STATUS,S_CATE) values (2,null,'기타고민','이직각을 어떻게 봐야할까요?...','<p>안녕하세요.</p><p>현재 윈폼을 개발하고 있는 4개월차 신입 개발자입니다.</p><p><a href="http://asp.net/">Asp.Net</a> 으로 넘어가려고 하는데 어떻게 넘어가야 좋을지 여쭤봅니다.</p><p>1.Asp.Net을 사용하는 회사로 바로 이직한다.</p><p>2.윈폼을 개발하면서 독학으로 Asp.Net을 공부하고 1년정도 후 이직한다.</p><p><br>&nbsp;</p><p>기타 좋은 의견있으면 조언 부탁드립니다.</p>',0,to_date('19/04/14','RR/MM/DD'),'sihus2@naver.com','FALSE','서버 개발자');
Insert into CONNECTJOB.S_TALK (S_NO,S_JOB,Q_TYPE,S_TITLE,S_CONTENT,S_HITS,S_DATE,P_ID,STATUS,S_CATE) values (3,null,'기타고민','저축 얼마나 해야될까요 한달 생활비...??','<p>안녕하세요... ㅋㅋ... 현재 27살이고 중소기업에 취직한지 2주 좀 넘어가네요</p><p>곧 월급이 나오는데용 3000+식대 별도 받고있습니다. 기본급으로 220조금 넘게 나오는데</p><p>여친은 없구요 ㅎㅎ;; 식비가 많이 나가는 상황인데요</p><p>140저축하고 80정도 생활비 쓸 계획인데</p><p>보통 80 생활비 잡으면 먹고싶은거 먹으면서 생활할 수 있겠죠??</p><p>점심은 회사에서 사주니까 그걸로 먹고 저녁도 야근하면 사주지만 안하게되면</p><p>저녁이나에 주말 맛있는 음식들 ㅎㅎ...</p><p>고정 지출은... 통신료(6만), 교통비(7만) 밖에 없는것 같아요 지금 떠오르는건...</p>',0,to_date('19/04/14','RR/MM/DD'),'sihus2@naver.com','FALSE','직종선택');
Insert into CONNECTJOB.S_TALK (S_NO,S_JOB,Q_TYPE,S_TITLE,S_CONTENT,S_HITS,S_DATE,P_ID,STATUS,S_CATE) values (4,null,'회사고민','입사했는데 버텨봐야 할까요?','<p>안녕하세요.</p><p>백앤드 자바 웹개발자 3년차로 이직 했습니다.</p><p>입사 한지는 아직 한 달 안됐어요.</p><p>입사를 했는데&nbsp;개발자들은 있는데 웹 개발자는 없네요.. ㅋㅋ</p><p>프로젝트와 산출물은 있지만 외주를 맡겼던 거네요.</p><p>(프론트는 jsp만 해봤는데 확인해보니 앵귤러로...)<br>&nbsp;</p><p>사무실 환경과 복지는 제가 볼 땐 나쁘지 않아요.</p><p>그런데 업무가 일상에서 많이 접해 보지 못했던 것 이기도 하고</p><p>혼자 a부터 z까지 파악하고 앞으로 혼자 개발할 생각을 하면..</p><p>빨리 결정을 내리는 게 좋을지</p><p>아니면 좀 더 지켜보는 게 좋을지 모르겠네요.</p><p>물론 결정은 제가 해야겠지만<br>&nbsp;</p><p>도움 될만한 조언이 있으면 부탁 드릴게요.</p>',0,to_date('19/04/14','RR/MM/DD'),'sihus2@naver.com','FALSE','자바 개발자');
Insert into CONNECTJOB.S_TALK (S_NO,S_JOB,Q_TYPE,S_TITLE,S_CONTENT,S_HITS,S_DATE,P_ID,STATUS,S_CATE) values (6,null,'회사고민','신입인데 왕꼰대를 만나서 힘듭니다...','<p>si회사에 입사한지 1개월 좀 지난 신입사원입니다.</p><p>약 2~3주전에 같은 팀 프로젝트 사람들과 회식을 하게 됐습니다. 저는 평소에 술을 한잔만 마셔도 빨개지는 타입입니다.</p><p>그런데 10초에 한번씩 잔을 비우게 만드니까 미치겠더라구요.</p><p>신입이라 뺄수도없고 그래서 일단 마신거죠</p><p>1차회식이 끝나고 2차로 갈때쯤 제가 힘들어서 못가겠다고 말을 했는데 그자리에서 아버지뻘 되는 부장에게 욕을 오지게 먹었습니다. 싸가지없는 새끼로 시작해서... 나때는말이야 밤새 술마시고 주는거 다 받아먹고 출근한사람이야 이러면서 헐크로 변하더라구요.. 평소에는 밝은사람인데 엄청난 다혈질이었던겁니다.</p><p>저는 그자리에서 충격을 먹고 2차로 끌려갔습니다. 그런 분위기에서 토 한 두세번 하면서 버티고 어찌저찌 다음날 출근하게 됐습니다.</p><p>이건 시작에 불과했습니다. 사과의 의미로 자기 집근처의 술집에서 술을 사겠데요 ;; 그래서 대리님이랑 또 끌려가게 됐습니다. 이날은 대리님의 약속으로 인해 무사히 돌아가긴했습니다.</p><p>그런데 문제는 과장님이 1주전에 휴가계획을 올려달라고 해서 월요일날 대리님과 제가 쉬기로 했습니다.</p><p>앞으로 바빠질거같아서 미리 쓰라고 한건가보다 생각하고 월요일 푹 쉬었습니다.</p><p>그런데 일이 터졌습니다. 다음날 출근하고, 왜 보고도 없이 쉬는거야 신입주제에 이러면서 막 주절주절 언성을 높이기 시작하면서 제 자존심도 막 건드렸습니다.. 너무 고통스러웠습니다.</p><p>이 날부터 지옥이 시작됐습니다. 프로젝트가 막 시작되는 단계여서 그런진 몰라도 매일 야근과 주말출근이 시작됐습니다. 겉으로는 착한척 하면서 내면은 왕꼰대입니다. 신입이라서 실력이 좋지 못한건 저도 알고있습니다. 그런데 저를 시험하려했던걸까요.. 개발을 시켰는데 제 시간에 완성을 못했습니다. 그 이유는 제 실력에도 문제가 있었겠지만, 30분~1시간? 마다 와서 이걸 아직도 못했어? 도대체 언제되는건데 이러면서 비꼬고는 담배피러 갑니다.. 너무 부담되서 집중도 안되더라구요..</p><p>그래서 결국 저는 메인일정에서 빠지고 서포트하는 업무를 하게 됐습니다.</p><p>다른 사람들은 진짜 좋은 사람들뿐인데 한 사람때문에 회사를 다니기 힘듭니다..</p><p>경력이나 실력은 쌓고싶은데 다른회사를 가서도 이런상황이 발생할까봐 모든걸 놓아버리고 싶고 그러더라구요</p><p>이런경우 선배님들도 겪은 적이 있으신가요? 겪으셨다면 어떤 선택을 하셨나요?</p>',0,to_date('19/04/14','RR/MM/DD'),'sihus2@naver.com','FALSE','직종선택');
